import TileArea from "./components/TileArea";

const dataObject = [
  {name: "Robert", job: "Walmart", hobby: "Finding rocks"},
  {name: "Tom", job: "Smith's", hobby: "Swimming"},
  {name: "Kyle", job: "Chevron", hobby: "Hanging with friends"},
  {name: "Ellie", job: "Joe's Crabshack", hobby: "Running"}
];

function App() {
  return (
    <div>
    <TileArea name={dataObject[0].name} job={dataObject[0].job} hobby={dataObject[0].hobby}/>
    <TileArea name={dataObject[1].name} job={dataObject[1].job} hobby={dataObject[1].hobby}/>
    <TileArea name={dataObject[2].name} job={dataObject[2].job} hobby={dataObject[2].hobby}/>
    <TileArea name={dataObject[3].name} job={dataObject[3].job} hobby={dataObject[3].hobby}/>
    </div>
  );
}

export default App;
